★タルテックスのソックスシューズ！<br>
<br>
●素足感覚でストレスフリーな履き心地を提供！<br>
●ウェットスーツのような通気性のあるアッパー素材と柔らかく曲がる滑りにくいソールが特徴！<br>
●シンプルなデザインで年齢、性別を問わずお使いいただけます！<br>
●柔らかな素材だから小さく丸めて持ち運びが出来ます！<br>
●内装業や介護などのワーキングシューズとして、また機内や室内履きなど幅広いシーンで活躍します。<br>
●3Eサイズ。<br>
<br>
■素材 ポリウレタン、合成ゴム<br>
<br>
※画像のカラーは、撮影時の照明等の具合により実物と異なる可能性がございます。<br>
